INSERT INTO `hotnews` VALUES (5,'http://tuoitre.vn/The-gioi/579595/the-gioi-chia-se-dau-thuong-philippines.html','11/11/2013 15:38 (GMT + 7)\r\nTTO - Nhiều nước và nhiều tổ chức trên thế giới đã nhanh chóng gửi nhân lực cùng đồ tiếp tế đến các khu vực bị siêu bão Haiyan tàn phá nặng nề ở Philippines.','/images/hotnews/thume_1384075585635.jpg','2013-11-10 09:26:25','Thế giới chia sẻ đau thương Philippines'),(6,'http://nld.com.vn/thoi-su-quoc-te/trieu-tien-xu-tu-80-nguoi-vi-xem-phim-han-2013111104022256.htm','16:38:45 11/11/2013\r\n(NLĐO) – Tờ JoongAng Ilbo dẫn nguồn tin “thân cận” với Bộ Nội vụ Triều Tiên cho biết khoảng 80 người bị tử hình vì tội xem phim Hàn Quốc hồi đầu tháng này.','/images/hotnews/thume_1384185809861.jpg','2013-11-11 16:03:29','Triều Tiên \"xử tử 80 người vì xem phim Hàn\"'),(7,'http://nld.com.vn/thoi-su-quoc-te/may-bay-boc-chay-khi-ha-canh-5-nguoi-chet-20131111044931756.htm','17:21:18 11/11/2013\r\n(NLĐO) – 5 người thiệt mạng và chỉ có 2 người sống sót khi chiếc máy bay cỡ nhỏ 19 chỗ ngồi phát nổ rồi bốc cháy khi hạ cánh tại một vùng nông thôn của tỉnh Ontario – Canada vào tối 10-11.','/images/hotnews/thume_1384185907315.jpg','2013-11-11 16:05:07','Máy bay bốc cháy khi hạ cánh, 5 người chết'),(8,'test','test','/images/hotnews/thume_1385016917122.jpg','2013-11-21 06:55:17','test'),(9,'dfd','dfdf','/images/hotnews/thume_1385018038667.jpg','2013-11-21 07:13:58','dfdf');
